def concatenate(strings: List[str]) -> str:
    """ Concatenate list of strings into a single string
    >>> concatenate([])
    ''
    >>> concatenate(['a', 'b', 'c'])
    'abc'
    """
    result = ''
    for string in strings:
        if string.startswith(' '):
            result +=''
        elif string.startswith('-'):
            result += '-'
        elif string.startswith('+'):
            result += '+'
        else:
            result += string
    return result

